function App() {
  return (
    <div>
      <h1>To do list</h1>
      <p>En liste over ting jeg skal gøre</p>
      <ul>
        <Todo Task={"Gør rent"} Done={false} Due={"20.10.2020"} />
        <Todo />
        <Todo />
        <Todo />
      </ul>
    </div>
  );
}

export default App;
